export default {
  content: [
    {
      name: "Brett & Kelly Hay",
      id: 1,
      description: "",
      paras: [
        {
          para:
            "Just wanted to publicly THANK YOU, we couldn’t have been happier with the food and service we received when you catered our wedding on the 2nd of January. You did above and beyond what we had expected and we are truly grateful!"
        }
      ]
    },
    {
      name: "Tasmanian eSchool",
      id: 1,
      description: "",
      paras: [
        {
          para:
            "Comments from staff was that “it was the best lunch they have had!!!” They loved rice paper rolls and the sushi, wraps were great too."
        }
      ]
    },
    {
      name: "TUTTI Committee",
      id: 1,
      description: "",
      paras: [
        {
          para:
            "Thank you all for providing us with the best conference food ever. For our delegates to be so well fed and looked after was one of the big contributing factors to running a happy event. You and your staff did a brilliant job. Thank you again."
        }
      ]
    },
    {
      name: "Michelle (University of Tasmania)",
      id: 1,
      description: "",
      paras: [
        {
          para:
            "It was a delight to engage the services of food2u for a large popular music studies conference I recently organised at the University of Tasmania. For three days, food2U staff prepared creative, varied menus using local Tasmanian produce. They also showed particular care and attention when accommodating delegates’ special dietary requirements, with vegetarian and gluten free options provided as part of the main menu each day. The food was a definite hit with the conference delegates – the quality of the catering received a special mention at the AGM!"
        }
      ]
    },
    {
      name: "Vicki (University of Tasmania)",
      id: 1,
      description: "",
      paras: [
        {
          para:
            "food2u not only have expert staff for catering arrangements but also the finest foods. The best quality canapés, drinks and service. I can recommend food2u to any organisation wishing to hold a special event."
        }
      ]
    },
    {
      name: "Karen Longey (Dominic College)",
      id: 1,
      description: "",
      paras: [
        {
          para:
            "I have used food2u for the past 12 months. They make my life ‘easy’. They have provided the following:"
        },
        {
          para:
            "Morning teas & afternoon teas, Dinners for meetings, BBQs, Easy pack lunches, Luncheons, Breakfast"
        },
        {
          para:
            "I usually ask Carole what she would suggest as a menu and to provide me with a quote. food2u have never let me down. They have always delivered at the required time and collected platters afterwards. Because the food is delicious people who attend our functions always ask who has catered for the event. I would highly recommend food2u for your next function."
        }
      ]
    },
    {
      name: "Pete",
      id: 1,
      description: "",
      paras: [
        {
          para:
            "Thank you for the catering for Wednesday, it was lovely, fresh and unique."
        }
      ]
    },
    {
      name: "Karen",
      id: 1,
      description: "",
      paras: [
        {
          para:
            "I wanted to share with you that the team, consisting of my Executives and State Managers and very happy with what you provided. Well done!"
        }
      ]
    },
    {
      name: "Pauline",
      id: 1,
      description: "",
      paras: [
        {
          para:
            "Thanks guys, what a great dinner party – you always come up trumps. My guests loved the menu and we had a great time. Cheers!"
        }
      ]
    },
    {
      name: "Morgen",
      id: 1,
      description: "",
      paras: [
        {
          para:
            "Everyone was really positive about the catering, especially they loved the quiches and sweets. I especially enjoyed dealing with friendly, efficient and reliable caterers. I won’t hesitate to recommend food2u to others within the RHH and hope to use your catering services again when next I am conducting a course."
        }
      ]
    }
  ]
};
